  [],\n\t\"num_tags\": 3,\n\t\"name\": \"flexible-production-of-geometrically-complex-superalloy-components-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In order to design and manufacture complex,
  one-of-a-kind to limited quantity rocket propulsion system components, while shortening
  the development cycle time and reducing the associated costs, an innovative method
  must be developed that expands upon current manufacturing technologies. A flexible
  manufacturing system that can handle the production of such parts in short time
  periods is desirable. Today's near-net fabrication technologies are extremely limited
  in design flexibility due to the use of injection molding. Considering the need
  for design flexibility as well as shorter development cycles, reduced costs, and
  minimized variance in making one-of-a-kind components, an innovative manufacturing
  technology will be demonstrated in this work to fabricate geometrically complex
  superalloy components.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
